// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.14;

import "./JoeSwapPool.sol";
import "./interfaces/IERC1155.sol";

//注意allowance的检查是发生在ui中
//mint操作只是transfer
//Swap跨区间transfer是执行多次transfer吗？
//ERC20是同质化的，只有总量，是不是计算出转移总和，转一次即可？
//ERC1155含有多种（多个bin），是不是要转多次？

contract JoeSwapManager{
    
    //这里为什么要return amount？
    //这里的data只在Manager里用过，为什么要传给Pool？
    //data中的token0和token1在Pool里也有，为什么不只传个payer就好了？
    function mint(
        address pool_address,
        int32 target_bin,
        uint128 amount,//X96
        bytes calldata data
    ) public returns(uint256 amount0,uint256 amount1){
        return JoeSwapPool(pool_address).mint(
            msg.sender,
            target_bin,
            amount,    
            data
        );
    }

    function JoeSwapMintCallback(
        int32 target_bin,
        uint256 amount0,
        uint256 amount1,
        bytes calldata data
        //!加个return测试一下
    ) public {
        //有没有可能是data出了问题!
        //data解码没问题
        //地址是不区分大小写的
        JoeSwapPool.CallBackData memory extra= abi.decode(
            data,
            (JoeSwapPool.CallBackData)
        );

        amount0=amount0>>FixedPoint96.RESOLUTION;
        amount1=amount1>>FixedPoint96.RESOLUTION;
        //_extra=extra;
        /*
        require(extra.token0==0xEf9f1ACE83dfbB8f559Da621f4aEA72C6EB10eBf,"token0 error");
        require(extra.token1==0x0498B7c793D7432Cd9dB27fb02fc9cfdBAfA1Fd3,"token1 error");
        require(extra.payer==0x5B38Da6a701c568545dCfcB03FcB875f56beddC4,"payer error");
        */
        //amount没问题
        //要么是extra.payer的问题 没问题
        //要么是target_bin的问题 没问题
        //!又是X96的问题 在ERC1155中_mint时没用X96导致余额不够
        IERC1155(extra.token0).safeTransferFrom(
            extra.payer,
            msg.sender,
            uint256(int256(target_bin)),
            amount0,
            data
        );
        IERC1155(extra.token1).safeTransferFrom(
            extra.payer,
            msg.sender,
            uint256(int256(target_bin)),
            amount1,
            data
        );

    }

}

contracts/JoeSwapPool.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.14;

import "./lib/Bins.sol";
import "./lib/Position.sol";
import "./lib/Indextree.sol";
import "./lib/FixedPoint96.sol";
import "./lib/TickMath.sol";
import "./lib/Math.sol";
import "./lib/SwapMath.sol";

import "./interfaces/IJoeSwapMintCallback.sol";
import "./interfaces/IERC1155Receiver.sol";

contract JoeSwapPool {

    using Bins for mapping(int32=>Bins.Info) ;
    using Position for mapping(bytes32=>Position.Info);
    using Position for Position.Info;
    using Indextree for mapping (int32 => uint256);

    error Invalidbinposition();
    error ZeroLiquidity();

    //bins上下界，得加2^23
    int32 internal constant MAX_BIN=9275880;
    int32 internal constant MIN_BIN=7501336;

    uint256 internal constant MIN_PRICE = 4295128739;
    uint256 internal constant MAX_PRICE = 1461446703485210103287273052203988822378723970342;

    //资产对的地址
    address public immutable token0;
    address public immutable token1;

    //实时位置
    //mint不会改变slot
    //swap有可能会改变slot
    struct Slot {
        // 实时pi
        uint256 pi;
        // 实时bin
        int32 bin;
    }
    Slot public slot;

    struct CallBackData{
        address token0;
        address token1;
        address payer;
    }

    struct SwapState{
        int32 bin;
        uint256 pi;
        uint128 active_liquidity;
        uint256 amountBeenOut;
        uint256 amountBeenIn;
    }

    struct Stepstate{
        uint256 startPrice;
        int32 nextBin;
        uint256 nextPrice;
        bool forSure;
        uint256 amountIn;
        uint256 amountOut;
    }

    //每个bin有多少L
    mapping (int32=>Bins.Info) bins;

    //每个LP在每个bin有多少L
    mapping (bytes32=>Position.Info) positions;

    mapping (int32 => uint256) indextree;

    //活跃流动性
    uint128 public liquidity;
    uint160 public composition;

    //初始化：
    //资产对地址
    //实时价格和bin
    constructor(
        address token0_,
        address token1_,
        uint256 _pi,
        int32 _bin
    ){  
        token0=token0_; 
        token1=token1_;
        slot=Slot({pi:_pi,bin:_bin});
    }

    function mint(
        address owner,
        int32 target_bin,
        uint128 amount,
        bytes calldata data
    )external returns (uint256 amount0,uint256 amount1){

        //检查参数
        if(target_bin>MAX_BIN || target_bin<MIN_BIN) revert Invalidbinposition();
        if(amount == 0) revert ZeroLiquidity();

       /*
        获取c的逻辑：
        是否是current_bin?{ 
          是：{
            是否初始化？{
                是：c=bins[target_bin].c;
                否：c=0.5;(引入浮点数)
            }
          }
          否：{
            大于还是小于？=>各自赋值
          }
        }
        */      

        //注意更新bins要在获取composition之后
        uint160 _composition;
        int32 current_bin = slot.bin;
        uint256 target_price=TickMath.getSqrtRatioAtTick(int24(target_bin-(1<<23)));
        if(target_bin == current_bin){

            if(bins[target_bin].initialized){
                _composition=bins[target_bin].composition;
            }else{
                //0.5*2^96不是这样算的，死猪
                //composition=uint160(5<<(FixedPoint96.RESOLUTION-1));
                _composition=uint160(1<<(FixedPoint96.RESOLUTION-1));
            }

            //为什么返回的amount要用uint256呢？注意L是uint128
            //因为amount用X96表示，所以要用大精度；L不用很大，因为不会有人花那么多钱。
            //这里传参的精度存在问题，传入的target_bin是Nb，没换算，应当传入(target_bin+2^23)
            amount0=Math.calcAmount0CurrentDelta(
              amount,
              _composition,
              target_price
            );
            amount1=Math.calcAmount1CurrentDelta(
              amount,
              _composition
            );
            //增加活跃流动性
            liquidity+=amount;
        }else if(target_bin > current_bin){
            _composition=0;
            amount0=Math.calcAmount0Inactive(amount,target_price);
        }else{
            _composition=uint160(1<<FixedPoint96.RESOLUTION); 
            amount1=Math.calcAmount1Inactive(amount);
        }

        //修改bins
        bool flippedbin=bins.update(target_bin,amount,_composition);

        //修改indextree
        if(flippedbin) indextree.flipBin(target_bin,1);

        //修改position
        Position.Info storage pos=positions.get(owner,target_bin);
        pos.update(amount);

        //执行转账
        //前面的计算都没问题，在ERC1155的第一步approve检查那里打断了
        IJoeSwapMintCallback(msg.sender).JoeSwapMintCallback(
            target_bin,
            amount0,
            amount1,
            data
        );


    }

    function swap(
        address recipient,
        uint256 expectedAmount,
        uint256 limitPrice,//X96
        bool zeroforone,
        bytes calldata data
    ) external returns(uint256 amount0,uint256 amount1){
        Slot memory _slot=slot;
        uint128 _liquidity=liquidity;

        bool validLimitPrice = zeroforone ? (limitPrice > _slot.pi && limitPrice <= MAX_PRICE)
                                          : (limitPrice < _slot.pi && limitPrice >= MIN_PRICE);

        require(validLimitPrice,"Invalid LimitPrice!");

        SwapState memory state=SwapState({
            bin: _slot.bin,
            pi: _slot.pi,
            active_liquidity:_liquidity,
            amountBeenOut: 0,
            amountBeenIn: 0
        });

        //寻找一个Initialized的bin

        while (expectedAmount>0 && state.pi<=limitPrice) {
            Stepstate memory step;
            step.startPrice=state.pi;

            uint256 pricePoint=step.startPrice;
            int32 binPoint=state.bin;
            while (pricePoint<=limitPrice) {
                (step.nextBin,step.forSure)=indextree.nextInitializedBinWithinOneWord(binPoint,1,zeroforone);
                //下一个bin不是未知的 或 已经被初始化
                //即为找到了下一个初始化的bin
                if(step.forSure || bins[step.nextBin].initialized){
                    break;
                }
                pricePoint=TickMath.getSqrtRatioAtTick(int24(step.nextBin-(1<<23)));
                binPoint=step.nextBin;
                if(pricePoint>limitPrice || binPoint>MAX_BIN) revert("liquidity not enough!");
            }

            if(!step.forSure) revert("liquidity not enough!");

            SwapMath.ComputeSwapParams memory computeSwapParams = SwapMath.ComputeSwapParams ({
                currentPrice: step.startPrice,
                activeLquidity: state.active_liquidity,
                activeComposition: composition,
                nextPrice: step.nextPrice,
                zeroForOne: zeroforone,
                amountRemain: expectedAmount 
            });


            ( state.pi , composition , step.amountIn , step.amountOut ) = SwapMath.computeSwap(computeSwapParams);
            expectedAmount-=step.amountOut;
            state.amountBeenOut+=step.amountOut;
            state.amountBeenIn+=step.amountIn;

            //是否要更新流动性
            if(state.pi == step.nextPrice){
                state.bin=step.nextBin;
                state.active_liquidity=bins[state.bin].liquidity;
            }

        }//while
        _slot.bin=state.bin;
        _slot.pi=state.pi;
        (amount0,amount1) = zeroforone ? (state.amountBeenIn,state.amountBeenOut) : (state.amountBeenOut,state.amountBeenIn);

    }



    function onERC1155Received(
        address operator,
        address from,
        uint256 id,
        uint256 value,
        bytes calldata data
    ) external returns (bytes4){
        bytes4 response = bytes4(keccak256("onERC1155Received(address,address,uint256,uint256,bytes)"));
        return response;
    }

    /**
     * @dev 接受ERC1155批量安全转账`safeBatchTransferFrom` 
     * 需要返回 0xbc197c81 或 `bytes4(keccak256("onERC1155BatchReceived(address,address,uint256[],uint256[],bytes)"))`
     */
    function onERC1155BatchReceived(
        address operator,
        address from,
        uint256[] calldata ids,
        uint256[] calldata values,
        bytes calldata data
    ) external returns (bytes4){
        bytes4 response = bytes4(keccak256("onERC1155BatchReceived(address,address,uint256[],uint256[],bytes)"));
        return response;
    }
}

