// SPDX-License-Identifier: MIT
pragma solidity ^0.8.14;

library Bins {

    //是否初始化
    //含有多少L
    struct Info{
        //一个bin初始化的依据？是否被使用过/是否有流动性
        bool initialized;

        uint128 liquidity;
        //X96
        uint160 composition;
    }

    //更新某个bin的信息
    function update(
        //Bins using for mapping()后，调用函数时第一个参不用填，调用自己
        mapping (int32 => Bins.Info) storage self,
        int32 bin,
        uint128 liquiditydelta,
        uint160 compositionAfter
    ) internal returns(bool flipped){

        Bins.Info storage target_bin=self[bin];

        if(target_bin.liquidity==0) target_bin.initialized=true;

        uint128 liquiditybefore=target_bin.liquidity;
        uint128 liquidityafter=liquiditybefore+liquiditydelta;

        //当流动性添加到一个空bin或者一个bin被耗尽时，翻转
        //这个flag是给Indextree用的，查看这个bin是否有流动性，是否要将这个位置翻转
        flipped = (liquidityafter == 0) != (liquiditybefore == 0);

        target_bin.liquidity=liquidityafter;

        target_bin.composition=compositionAfter;
    }

}

