// SPDX-License-Identifier: MIT
pragma solidity ^0.8.14;

import "prb-math/PRBMath.sol";
import "./FixedPoint96.sol";

library Math{
    //calcAmount函数面临3种情况：target_bin高于/低于/等于现bin

    //target_bin=current_bin
    //delta x
    function calcAmount0CurrentDelta(
        uint128 liquidity,
        uint160 composition,
        uint256 target_price
    ) internal pure returns (uint256 amount0) {
        //在uniswap中，都用Q64.96来统一计算,也就是说，涉及到浮点数的计算，都要把所有算数转换成同一种形式来计算
        //返回结果也是Q64.96
        //这里存在微小的精度损失
        //这里返回X96
        uint160 OneX96=uint160(1<<96);
        amount0 = mulDivRoundingUp(
            (uint256(liquidity) << FixedPoint96.RESOLUTION),
            (OneX96-composition),
            target_price << FixedPoint96.RESOLUTION
        );
        //这里返回X96，其实还得除一次，因为虽然乘式里多了一个X96出来，但是每个变量本身都是X96
        //amount0=amount0>>FixedPoint96.RESOLUTION;
        //不用，没问题    
    }

    //delta y
    function calcAmount1CurrentDelta(
        uint128 liquidity,
        uint160 composition
    ) internal pure returns(uint256 amount1){
        //这里其实不用这么麻烦，但是为了代码的一致性我们传入X96
        amount1=PRBMath.mulDiv(
            (uint256(liquidity) << FixedPoint96.RESOLUTION),
            composition,
            1<< FixedPoint96.RESOLUTION
        );

    }


    //target_bin!=current_bin
    function calcAmount0Inactive(
        uint128 liquidity,
        uint256 target_price
    ) internal pure returns(uint256 amount0){
        amount0=PRBMath.mulDiv(
            (uint256(liquidity) << FixedPoint96.RESOLUTION),
            (1<< FixedPoint96.RESOLUTION),
            target_price
        );
    }

    function calcAmount1Inactive(
        uint128 liquidity
    ) internal pure returns(uint256 amount1){
        amount1=(uint256(liquidity) << FixedPoint96.RESOLUTION);
    }

    function calcCompositionAtAmount0(
        uint256 price,
        uint128 liquidity,
        uint256 deltaAmount0
    ) internal pure returns(uint160 deltaComposition){
        deltaComposition = uint160(mulDivRoundingUp(
            (price<<FixedPoint96.RESOLUTION),
            deltaAmount0,
            (liquidity<<FixedPoint96.RESOLUTION)
        ));
    }

    function calcCompositionAtAmount1(
        uint128 liquidity,
        uint256 deltaAmount1
    ) internal pure returns(uint160 deltaComposition){
        deltaComposition = uint160(mulDivRoundingUp(
            deltaAmount1,
            (1<< FixedPoint96.RESOLUTION),
            (liquidity<<FixedPoint96.RESOLUTION)
        ));
    }


    function mulDivRoundingUp(
        uint256 a,
        uint256 b,
        uint256 denominator
    ) internal pure returns (uint256 result) {
        result = PRBMath.mulDiv(a, b, denominator);
        if (mulmod(a, b, denominator) > 0) {
            require(result < type(uint256).max);
            result++;
        }
    }

}

