// SPDX-License-Identifier: MIT
pragma solidity ^0.8.14;

import "./Math.sol";

library SwapMath {
    struct ComputeSwapParams {
        uint256 currentPrice;
        uint128 activeLquidity;
        uint160 activeComposition;//X96
        uint256 nextPrice;
        bool zeroForOne;
        uint256 amountRemain;//X96       
    }

    function computeSwap( ComputeSwapParams memory computeSwapParams ) internal pure returns(
        uint256 _nextPice,
        uint160 compositionAfter,
        uint256 amountIn,
        uint256 amountOut
    ){
        uint256 currentPrice = computeSwapParams.currentPrice;
        uint128 activeLquidity = computeSwapParams.activeLquidity;
        uint160 activeComposition = computeSwapParams.activeComposition;//X96
        uint256 nextPrice = computeSwapParams.nextPrice;
        bool zeroForOne = computeSwapParams.zeroForOne;
        uint256 amountRemain = computeSwapParams.amountRemain;//X96
        
        //当前区间能提供的最大流动性
        if(zeroForOne){
            //流出y
            //turn right:delta y
            //要重新写计算公式，mint和swap的条件不一样
            //差不多
            amountOut=Math.calcAmount1CurrentDelta(
                activeLquidity,
                activeComposition
            );
        }else{
            //流出x
            amountOut=Math.calcAmount0CurrentDelta(
                activeLquidity,
                activeComposition,
                currentPrice
            );
        }
        
        //uniswap中并不是跳到下一个未知的tick
        //uniswap中nextPrice是作为当前区间的上/下界
        //富余，在当前pi内跳转，更新composition
        //刚好或不足，跳边界
        if(amountOut > amountRemain){
            amountOut=amountRemain;
            uint160 deltaComposition;
            //更新composion
            if(zeroForOne){
                //流出y
                deltaComposition = Math.calcCompositionAtAmount1(
                    activeLquidity,
                    amountOut
                );
                uint160 OneX96=uint160(1<<FixedPoint96.RESOLUTION);
                amountIn = Math.calcAmount0CurrentDelta(
                    activeLquidity,
                    (OneX96-deltaComposition),
                    currentPrice
                );
                compositionAfter = activeComposition - deltaComposition;
                
            }else{
                //流出x
                deltaComposition = Math.calcCompositionAtAmount0(
                    currentPrice,
                    activeLquidity,
                    amountOut
                );
                amountIn= Math.calcAmount1CurrentDelta(
                    activeLquidity,
                    deltaComposition
                );
                compositionAfter = activeComposition + deltaComposition; 
            }

            _nextPice=currentPrice;

        }else{
            if(zeroForOne){
                //流出y
                uint160 OneX96=uint160(1<<96);
                amountIn=Math.calcAmount0CurrentDelta(
                    activeLquidity,
                    (OneX96-activeComposition),
                    currentPrice
                );
                amountOut=Math.calcAmount1CurrentDelta(
                    activeLquidity,
                    activeComposition
                );
                compositionAfter=1;

            }else{
                //流出x
                uint160 OneX96=uint160(1<<FixedPoint96.RESOLUTION);
                amountIn=Math.calcAmount1CurrentDelta(
                    activeLquidity,
                    (OneX96-activeComposition)
                );
                amountOut=Math.calcAmount0CurrentDelta(
                    activeLquidity,
                    activeComposition,
                    currentPrice
                );
                compositionAfter=0;
            }

            _nextPice=nextPrice;
        }


    }
}

